import React from 'react';
// styles.
import '../styles/categoryItem.scss';
const CategoryItem = ({imageUrl, name}) => (
    <div>
        <img src={imageUrl} alt={imageUrl} />
        <button>ADD TO CART</button>
        <p>name</p>
    </div>
);

export default CategoryItem;
